export default function UserInfo(props){
    return(
        <div className="user">
            <div>
                {props.username}
            </div>
            <div>
                {props.age}
            </div>
            <div>
                <img src={require(props.image).default} alt="fhjg" />
            </div>
        </div>
    )
}
